Vicmap Planning History is the map data representing the land use zone and overlay controls for all Victorian planning schemes. Planning schemes cover the 79 local government areas and three other areas in Victoria. Planning schemes are regularly amended, and Vicmap Planning is continually updated to reflect the official planning scheme at any time. 

Datasets in the series are listed below.  See them for more detailed metadata.
- Planning scheme zones - Vicmap Planning (VMPLAN_PLAN_ZONE_HISTORY);
- Planning scheme overlay - Vicmap Planning (VMPLAN_PLAN_OVERLAY_HISTORY);
- Planning scheme codelist - Vicmap Planning (VMPLAN_PLAN_CODELIST)
Current data model is Version 3.0.1 (Draft) 15 July 2017.

__The IPA Authority File__ (conforming to WIPO standard ST.37) published herein provides a sequential gap-free list of all patent document publication numbers (AU application number / AU 10-digit number) issued by IP Australia since 1904 to a total of greater than 1.9 million patent records and will be updated monthly.

__The primary purpose of the authority file__ is to allow other IPOs and related interested parties to understand what publications have been made available by IP Australia, and which of these are available with searchable text.

This published authority file is in __TXT(CSV) format__. 

__Data elements__ incorporated in this TXT based Authority File are as follows:

(a) __publication authority__ (two-letter alphabetic code of the Intellectual Property Office (IPO) publishing the document);

(b) __publication number__;

(c) __kind of document code__;

(d) __publication date__;

(e) __publication exception code__ (indicates any missing publications using code ‘M’);

(f) __searchable abstract code__ (indicates whether searchable text from the abstract is available);

(g) __searchable description code__ (indicates whether searchable text from the description is available);  and

(h) __searchable claims code__ (indicates whether searchable text from the claims is available)

